INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (57878, 1408, 'Iron Dextran', 'Cardiomyopathies', 'Cardiac toxicity such as chest pain and tightness, shock, hypertension, tachycardia and arrhythmia have occurred during iron dextran therapy.  Hypotension and flushing have been reported and are thought to be infusion- rate related.  Adverse reactions experienced following therapy with iron dextran may exacerbate cardiovascular complications in patients with preexisting cardiovascular disease, caution is advised.', '2', '', 'DDInter', 0);
